import './startWave.css'
import UserInfo from './UserInfo';
import './Main.css';
import logoImg from '../../image/LogoImage.png';
import Button from './Button';
import './Button.css';
import styled from 'styled-components';
import WaveImage from '../../image/apWave.png';
const WaveButton = styled.button`
        background-color: #ffffff;
        color: #ec132e;
        background-image: url(${WaveImage});
        background-repeat: no-repeat;
        background-size: cover;
        background-size: 100% 100%;
        background-position-y: 50px;
        border: 1px solid #ec132e;
        transition: 0.4s;
        font-size: 1.6rem;
        width: 21.6rem;
        height: 5.2rem;

    &:hover {
        color: #ffffff;
        background-position-y: -1000px;
        background-size: 1000% 4000%;
    }
`;

function Main() {


    const logo = logoImg;
    return (
    <>
        <div className='start'></div>
        <div className='main-container'>
            <div className='left-container'>
                <img className='main-logo-img' src={logo} alt="Fullio Logo" />
                <Button className={'log-out-btn wave-btn'} value={'로그아웃'} />
                <WaveButton>로그아웃</WaveButton>
            </div>
            <div className='cneter-container'>
            </div>
            <div className='right-container'>
                <UserInfo />
            </div>
        </div>
    </>
    )
}

export default Main;
